import React from 'react';
import PropTypes from 'prop-types';
import { connect } from 'react-redux';
import meat from '../icons/005-meat.png';
import no_meat from '../icons/004-no-meat.png';
import pizza from '../icons/006-pizza-slice.png';
import grocery from '../icons/008-grocery.png';

export const Filter = (props) => {
  return (
    <div
      style={{
        float: 'right',
        border: '2px solid black',
        width: '320px',
        height: '90vh',
        marginRight: '10px',
      }}
    >
      <img src={meat} alt="Meat" /> &nbsp;
      <img src={no_meat} alt="no_Meat" a href="/" />
      <br></br>
      <br></br>
      <img src={pizza} alt="pizza" a href="/" /> &nbsp;
      <img
        src={grocery}
        alt="grocery"
        a
        href="/"
        class="waves-effect waves-light btn-large"
      />
    </div>
  );
};

Filter.propTypes = {
  props: PropTypes,
};

const mapStateToProps = (state) => ({});

const mapDispatchToProps = {};

export default connect(mapStateToProps, mapDispatchToProps)(Filter);
